package com.class09;

public class CarOdometerLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for (int i=0; i<=9; i++) {
			for (int j=0; j<=9; j++) {
				for (int k=0; k<=9; k++) {
					for (int p=0; p<=0; p++) {
						System.out.println(i+" "+j+" "+k+" "+p);
					}
				}
			}
		}

	}

}
